import kasa from "../json/kasa.json";

function Article() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        flexWrap: "wrap",
        justifyContent: "space-around",
        marginTop: 40,
        backgroundColor: "#F6F6F6",
        borderRadius: 25,
        padding: "40px 0",
      }}
    >
      {kasa.map((item, index) => (
          <div key={item.id} style={{
            width: 340,
            height: 340,
            margin: "20px 20px",
            borderRadius: 10,
          }}>
        <img

          src={item.cover}
          alt={item.title}

        />
        </div>
      ))}
    </div>
  );
}

export default Article;
